import './Style.css'
import {Text, StyleSheet} from 'react-native';


function Home() {
    return(
        <>
        <h1>nav bar</h1>
        <div className="home-title">
         <Text style={styles.titleText}>City Jail Information Center</Text>
        </div>
        <h1>manage information</h1>
        <h1>sign out</h1>
        </>
    )
}

const styles = StyleSheet.create({
    titleText: {
      fontSize: 70,
      fontWeight: 'bold',
      color: 'white',
    },
    authText: {
        fontSize: 35,
        fontWeight: 'normal',
        color: 'black',
        top: 30,
    },
    buttonText: {
        fontSize: 24,
        fontWeight: 'normal',
        color: 'white',
    }
  });

export default Home;
